/*Table structure for table `jc_line` */

DROP TABLE IF EXISTS `jc_line`;

CREATE TABLE `jc_line` (
  `lname` char(64) DEFAULT NULL COMMENT '线路名称',
  `info` char(128) DEFAULT NULL COMMENT '备注信息',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bid` smallint(6) DEFAULT NULL COMMENT '开始站点id',
  `eid` smallint(6) DEFAULT NULL COMMENT '结束站点id',
  `lcolor` char(64) DEFAULT NULL COMMENT '线路颜色',
  `lename` char(128) DEFAULT NULL COMMENT '英文名',
  UNIQUE KEY `id` (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8;

