/*Table structure for table `jc_line_stations` */

DROP TABLE IF EXISTS `jc_line_stations`;

CREATE TABLE `jc_line_stations` (
  `sid` int(11) DEFAULT '0' COMMENT '站点id',
  `lid` int(11) DEFAULT '0' COMMENT '所属线路',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pos` smallint(6) DEFAULT '0' COMMENT '线路站点顺序编号',
  `dir` smallint(6) DEFAULT '0' COMMENT '1:顺序方向 0:反方向',
  PRIMARY KEY (`id`),
  KEY `FK_jc_station` (`lid`) USING BTREE,
  KEY `FK_jc_line_stations_sid` (`sid`) USING BTREE,
  CONSTRAINT `jc_line_stations_ibfk_1` FOREIGN KEY (`sid`) REFERENCES `jc_station` (`id`) ON DELETE CASCADE,
  CONSTRAINT `jc_line_stations_ibfk_2` FOREIGN KEY (`lid`) REFERENCES `jc_line` (`id`) ON DELETE CASCADE
