/*Table structure for table `jc_station` */

DROP TABLE IF EXISTS `jc_station`;

CREATE TABLE `jc_station` (
  `sname` char(64) DEFAULT NULL COMMENT '站点名称',
  `info` char(128) DEFAULT NULL COMMENT '站点信息',
  `lat` char(64) DEFAULT NULL COMMENT '维度',
  `lot` char(64) DEFAULT NULL COMMENT '精度',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` smallint(6) DEFAULT '1' COMMENT '0,A;1,B;2,岛式',
  `rid` int(11) DEFAULT '0' COMMENT 'related id,相关联的id,即对面站台的id',
