  `ny` int(11) DEFAULT NULL COMMENT '站点名称y坐标',
  `ndir` smallint(6) DEFAULT NULL COMMENT '文字排版方向，0横排，1竖排',
  `py` char(32) DEFAULT NULL COMMENT '站点拼音首字母',
  `ex` int(11) DEFAULT NULL COMMENT '站点英文名x坐标',
  `ey` int(11) DEFAULT NULL COMMENT '站点英文名y坐标',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=202 DEFAULT CHARSET=utf8;

