/*Table structure for table `jy_checkdetail` */

DROP TABLE IF EXISTS `jy_checkdetail`;

CREATE TABLE `jy_checkdetail` (
  `auto_sn` bigint(20) NOT NULL DEFAULT '0',
  `termno` char(32) NOT NULL,
  `datatime` int(11) NOT NULL,
  `macsn` char(16) NOT NULL,
  `tradeid` bigint(20) NOT NULL COMMENT '终端交易流水',
  `operation` int(11) NOT NULL COMMENT '交易明细代码(见附一)',
  `amount` int(11) NOT NULL COMMENT '交易金额(单位:分)',
  `cardid` char(24) NOT NULL COMMENT '卡号',
  `param1` int(11) NOT NULL COMMENT '参数1',
  `param2` int(11) NOT NULL COMMENT '参数2',
  `cardtype` smallint(6) NOT NULL COMMENT '卡类型,0,新域临时卡 1,珠海通达卡 2,银联卡 3,有轨员工卡 4,珠海通 5,岭南通 ',
  `subtype` smallint(6) NOT NULL COMMENT '卡子类型',
  `stime` int(11) NOT NULL COMMENT '服务器接收数据时间',
  `receipts` varchar(520) DEFAULT NULL,
  `needReUpload` smallint(1) DEFAULT '0' COMMENT '是否需要重新上传此条对帐，0不需要，1需要',
  PRIMARY KEY (`tradeid`),
  KEY `ind_time_sn` (`datatime`,`macsn`) USING BTREE,
  KEY `ind_trade` (`tradeid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

