DROP TABLE IF EXISTS `kc_blankcard`;

CREATE TABLE `kc_blankcard` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '单据编号',
  `kc_type` smallint(6) DEFAULT NULL COMMENT '0,入库;1出库;3报废;4撤销',
  `day` int(11) DEFAULT NULL COMMENT '日期',
  `amount` int(11) DEFAULT NULL COMMENT '数量',
  `manufacturer` char(128) DEFAULT NULL COMMENT '制造商',
  `oper` char(64) DEFAULT NULL COMMENT '操作员',
  `info` char(128) DEFAULT NULL COMMENT '出库详细备注',
  `reason` char(128) DEFAULT NULL COMMENT '操作原因',
