  `store` int(11) DEFAULT NULL COMMENT '操作前库存',
  `memoid` int(11) NOT NULL DEFAULT '0' COMMENT '备注ID号（0添加，非0追加）',
  `bill_num` int(11) DEFAULT '0' COMMENT '单号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=289 DEFAULT CHARSET=utf8;

