/*Table structure for table `run_cashbox` */

DROP TABLE IF EXISTS `run_cashbox`;

CREATE TABLE `run_cashbox` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `cashboxid` char(16) NOT NULL COMMENT '现金钞箱编号',
  `termno` char(32) NOT NULL,
  `startno` int(11) DEFAULT NULL,
  `offset` int(11) DEFAULT NULL COMMENT '调整量,例如配置时少点钞或者点错情况下可以调整',
  `starttime` int(11) DEFAULT NULL,
  `endtime` int(11) DEFAULT NULL,
  `incid` int(11) DEFAULT NULL,
  `state` smallint(6) DEFAULT NULL COMMENT '状态:1正在使用,2已回收,3已上传',
  `par` smallint(6) DEFAULT NULL COMMENT '钞箱币种类别与编码定义一致(1:1元；3：5元；4：10元)',
  `dir` smallint(6) DEFAULT NULL COMMENT '1入钞 2出钞',
  `macsn` char(16) NOT NULL COMMENT '机器id',
  `runcnt` smallint(6) DEFAULT '1',
  `changeid` int(11) DEFAULT '1' COMMENT '一次清机内，此种类型容器更换的顺序id',
  PRIMARY KEY (`id`)
