/* Function  structure for function  `func_get_cardtype` */

/*!50003 DROP FUNCTION IF EXISTS `func_get_cardtype` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `func_get_cardtype`(`cardtype` INT) RETURNS varchar(255) CHARSET utf8
BEGIN
  DECLARE result VARCHAR(255) DEFAULT '';
 
  IF cardtype = 0 THEN
   SET result = '有轨电车卡';
  ELSEIF cardtype = 1 THEN
   SET result = '通达卡';
  ELSEIF cardtype =2 THEN
   SET result = '银联卡';
  ELSEIF cardtype =3 THEN
   SET result = '员工卡';
  ELSEIF cardtype =4 THEN
   SET result = '珠海通';
  ELSEIF cardtype =5 THEN
   SET result = '岭南通';
  ELSEIF cardtype =6 THEN
   SET result = '中山通';
  END IF;
 
 RETURN result;
END */$$
DELIMITER ;

