        ON c.lid=d.lid ORDER BY lid,sname,macsn;
    
     SET @SQL = CONCAT("SELECT * FROM device_tmp WHERE 1=1 ",COND1);   
     PREPARE stmt FROM @SQL;
     EXECUTE stmt;
     DEALLOCATE PREPARE stmt; 
    END */$$
DELIMITER ;

